import { Container } from "./style"

export const Header = () => {

    return (

        <Container>
            <div className="logo">Logo</div>
            <ul>
                <li>Casamento</li>
                <li>Formatura</li>
                <li>Festa</li>
            </ul>

        </Container>
    )
}
